import React, { useState } from "react";
import { Link } from "react-scroll";
import MenuBtn from "../../assests/MenuBtn.png";
import Resume from "../../Karanveer_Sidhu_Resume.pdf";

const Navbar = () => {
    const [showMenu, setShowMenu] = useState(false);

    return (
        <nav className="bg-green-400 text-white sticky top-0 z-50 shadow-md">
            <div className="max-w-6xl mx-auto px-4 py-3 flex items-center justify-between">
                {/* Logo */}
                <Link
                    to="intro"
                    smooth={true}
                    duration={500}
                    offset={-50}
                    className="hover:text-green-100 transition cursor-pointer"
                >
                    <span className="text-lg font-bold text-white">
                        Yusriyah Rahman
                    </span>
                </Link>

                {/* Desktop Menu */}
                <div className="hidden md:flex items-center space-x-6">
                    <Link
                        to="skills"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100 transition cursor-pointer"
                    >
                        About
                    </Link>
                    <Link
                        to="myPortfolio"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100 transition cursor-pointer"
                    >
                        Portfolio
                    </Link>
                    <Link
                        to="experience"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100 transition cursor-pointer"
                    >
                        Experience
                    </Link>
                    <Link
                        to="contactPage"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100 transition cursor-pointer"
                    >
                        Contact
                    </Link>
                </div>

                {/* Action Buttons */}
                <div className="hidden md:flex items-center space-x-4">
                    <a
                        href={Resume}
                        download="Karanveer_Sidhu_Resume.pdf"
                        className="px-4 py-2 rounded-lg border border-white hover:border-green-100 hover:text-green-100 transition"
                    >
                        Resume
                    </a>
                    <button
                        onClick={() =>
                            document
                                .getElementById("contactPage")
                                .scrollIntoView({ behavior: "smooth" })
                        }
                        className="px-4 py-2 rounded-lg bg-white text-green-400 hover:bg-green-100 transition"
                    >
                        Contact Me
                    </button>
                </div>

                {/* Mobile Menu Button */}
                <button
                    onClick={() => setShowMenu(!showMenu)}
                    className="md:hidden p-2 rounded-md hover:bg-green-300 transition"
                >
                    <img src={MenuBtn} alt="Menu" className="h-6 w-6" />
                </button>
            </div>

            {/* Mobile Dropdown */}
            {showMenu && (
                <div className="md:hidden bg-green-400 text-white flex flex-col space-y-2 px-4 py-3">
                    <Link
                        to="intro"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100"
                        onClick={() => setShowMenu(false)}
                    >
                        Home
                    </Link>
                    <Link
                        to="skills"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100"
                        onClick={() => setShowMenu(false)}
                    >
                        About
                    </Link>
                    <Link
                        to="myPortfolio"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100"
                        onClick={() => setShowMenu(false)}
                    >
                        Portfolio
                    </Link>
                    <Link
                        to="experience"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100"
                        onClick={() => setShowMenu(false)}
                    >
                        Experience
                    </Link>
                    <Link
                        to="contactPage"
                        smooth={true}
                        duration={500}
                        offset={-50}
                        className="hover:text-green-100"
                        onClick={() => setShowMenu(false)}
                    >
                        Contact
                    </Link>
                    <a
                        href={Resume}
                        download="Karanveer_Sidhu_Resume.pdf"
                        className="hover:text-green-100"
                        onClick={() => setShowMenu(false)}
                    >
                        Resume
                    </a>
                </div>
            )}
        </nav>
    );
};

export default Navbar;
